import '../styles/home.css';

export default function Home() {
    return (
        <div className="main container-fluid mb-4">
            <div className="d-flex flex-wrap justify-content-center rowmain">


                <div className="rightmain flex-shrink-1">
                    <h1 className="name"> Angelica Hernandez </h1> <br>
                        <h2 className="jobtitle"> UX | UI Designer
                        Full Stack Developer</h2>
                    </br>
                </div>
            </div>

        </div>
    );
}
